//Universal A(i, j, k, l, m, n, o, )*B(p, q, r, s, t, ) triple contraction
template<class A, class B, class T, class U, int Dim0, int Dim1, int Dim2, int Dim3, int Dim4, int Dim5, int Dim6, int Dim7, int Dim8, int Dim9, int Dim10, int Dim11, char i, char j, char k, char l, char m, char n, char o, char p, char q, char r, char s, char t, int DimA, int DimB, int DimC, int DimD, int DimX, int DimY, int DimZ, int DimW, int DimV, char a, char b, char c, char d, char x, char y, char z, char w, char v>
class Tensor7_times_Tensor5_triple
{
  Tensor7_Expr<A, T, Dim0, Dim1, Dim2, Dim3, Dim4, Dim5, Dim6, i, j, k, l, m, n, o> iterA;
  Tensor5_Expr<B, U, Dim7, Dim8, Dim9, Dim10, Dim11, p, q, r, s, t> iterB;

public:
  typename promote<T, U>::V operator()(const int N1, const int N2, const int N3, const int N4, const int N5, const int N6) const
  {
    typename promote<T, U>::V result(0);
    for(int xx = 0; xx < DimX; ++xx)
      for(int yy = 0; yy < DimY; ++yy)
        for(int zz = 0; zz < DimZ; ++zz)
          {
            // Permutation is where the indices get checked.
            result += Permutation7<DimA, DimB, DimC, DimD, DimX, DimY, DimZ, a, b, c, d, x, y, z>().eval(
              iterA, N1, N2, N3, N4, xx, yy, zz) * Permutation5<DimX, DimY, DimZ, DimW, DimV, x, y, z, w, v>().eval(iterB, xx, yy, zz, N5, N6);
          }
    return result;
  }

  Tensor7_times_Tensor5_triple(
    const Tensor7_Expr<A, T, Dim0, Dim1, Dim2, Dim3, Dim4, Dim5, Dim6, i, j, k, l, m, n, o> &iter_a,
    const Tensor5_Expr<B, U, Dim7, Dim8, Dim9, Dim10, Dim11, p, q, r, s, t> &iter_b)
      : iterA(iter_a), iterB(iter_b)
  {}
};

