template<class A, class B, class T, class U, int Dim0, int Dim1, int Dim2, int Dim3, int Dim4, int Dim5, int Dim6, int Dim7, int Dim8, char i, char j, char k, char l, char m, char n, char o, char p, char q>
auto operator*(const Tensor7_Expr<A, T, Dim0, Dim1, Dim2, Dim3, Dim4, Dim5, Dim6, i, j, k, l, m, n, o> &a,
               const Tensor5_Expr<B, U, Dim2, Dim1, Dim0, Dim7, Dim8, k, j, i, p, q> &b)
{
  using TensorExpr
    = Tensor7_times_Tensor5_triple<A, B, T, U, Dim0, Dim1, Dim2, Dim3, Dim4, Dim5, Dim6, Dim2, Dim1, Dim0, Dim7, Dim8, i, j, k, l, m, n, o, k, j, i, p, q, Dim3, Dim4, Dim5, Dim6, Dim0, Dim1, Dim2, Dim7, Dim8, l, m, n, o, i, j, k, p, q>;
  return Tensor6_Expr<TensorExpr, typename promote<T,U>::V, Dim3, Dim4, Dim5, Dim6, Dim7, Dim8, l, m, n, o, p, q>(TensorExpr(a, b));
}

